import React from 'react';

const OpenFormButton = ({ openFormPage }) => {
  const handleClick = () => {
    openFormPage(); // Call the callback function to open the form page
  };

  return (
    <button onClick={handleClick}>Open Form</button>
  );
};

export default OpenFormButton;
